import './Home.css';
import repDir from '../../repGood.json'


function Home() {
  // console.log(repDir);
  for (let i=0; i < repDir.length; i++) {
    console.log(repDir[i].songTitle);
  }
  return (
    <div className="home">
      <div className="parent">
        <div className="div1">
          <p>
            Showing <em>400</em> of <em>405</em> songs in the collection.
          </p>
        </div>
        <div className="div2">
          {' '}
          <p>search by title</p>
        </div>
        <div className="div3">
          <p>title | recording | game | add to list</p>
        </div>
        <div className="div4">
          <p>refine search</p>
          <p>reset</p>
          <p>dropdown 1</p>
          <p>dropdown 2</p>
          <p>dropdown 3</p> <p>dropdown 4</p> <p>dropdown 5</p>{' '}
          <p>dropdown 6</p>{' '}
        </div>
        <div className="div5">song list</div>
      </div>
    </div>
  );
}

export default Home;
